    <div className="App">
      <Nav />
      <Wrapper>
        <Route exact path="/" component={About} />
        <Route exact path="/about" component={About} />
        <Route exact path="/contact" component={Contact} />
        <Route exact path="/portfolio" component={Portfolio} />
      </Wrapper>
      <CardWrapper>
        <MovieCard />
        <MovieCard />
        <MovieCard />
        <MovieCard />
      </CardWrapper>
      <Footer />
    </div>
  );
}

